import React from "react";
import "./nav.css";
import home from "../assets/images/home.svg";
const Nav=()=>{
    return(
        <nav>
            <ul>
                <li id="home"><span><img class="navIcon" src={home} alt="home icon" /></span><span className="active">Home </span></li>
                <li id="connections"><span><img class="navIcon" src={home} alt="home icon" /></span><span className="inactive">Connections</span></li>
                <li id="search"><span><img class="navIcon" src={home} alt="home icon" /></span><span className="inactive">Search</span></li>
                <li id="notifications"><span><img class="navIcon" src={home} alt="home icon" /></span><span className="inactive">Notifications</span></li>
                <li id="profile"><span><img class="navIcon" src={home} alt="home icon" /></span><span className="inactive">Profile</span></li>
            </ul>
        </nav>
    )
}
export default Nav;
